import styled from "styled-components";

// Styled component named StyledButton
const StyledButton = styled.button`
width: 5rem;
height: 5rem;
/* margin: 0.1rem; */
text-align: center;
font-size: 150%;
padding: 0;
border-top: 1px solid #777;
border-right: 1px solid #666;  
`;


export default StyledButton;
